<!DOCTYPE html>
<html lang="en">
<head>
  <meta charset="UTF-8">
  <meta name="viewport" content="width=device-width,initial-scale=1.0" />
  <title>Family</title>
  <script src="d3.min.js"></script>
  <script src="family-chart.min.js"></script>
  <script src="./jscss/aes.js"></script>
  
  <link rel="stylesheet" href="elements/family-chart.css"> 
  <style>
	body{
	margin:0;
	}
	.f3{
	height: 100vh;
	max-height: unset;
	width: 100vw;
	max-width: unset;
	margin: auto;
	position: relative;
	overflow: hidden;
	}
  </style>
</head>
<body>
  <div id="FamilyChart" class="f3"></div>
  <script type="module">
    
    const store = f3.createStore({
        data: data(),
        node_separation: 250,
        level_separation: 150
      }),
      view = f3.d3AnimationView({
        store,
        cont: document.querySelector("#FamilyChart")
      }),
      Card = f3.elements.Card({
        store,
        svg: view.svg,
        card_dim: {w:220,h:70,text_x:75,text_y:15,img_w:60,img_h:60,img_x:5,img_y:5},
        card_display: [d => `${d.data['first name'] || ''} ${d.data['last name'] || ''}`,d => `${d.data['birthday'] || ''}`],
        mini_tree: true,
        link_break: false
      })
  
    view.setCard(Card)
    store.setOnUpdate(props => view.update(props || {}))
    store.update.tree({initial: true})
    
    function data() {
	var a = location.href; 
	var b = a.substring(a.indexOf("?")+1);
	return JSON.parse(CryptoJS.AES.decrypt(origin_data(), b).toString(CryptoJS.enc.Utf8));
	}
